function backgroundText() {
    const container = document.getElementById('imageContainer');

    // 기존 배경 이미지 제거
    const existingBackgroundImg = document.getElementById('texture');
    if (existingBackgroundImg) {
        container.removeChild(existingBackgroundImg);
    }

    const backgroundImg = document.createElement('img');
    backgroundImg.src = texture; // 여기에 base64 인코딩된 이미지 문자열을 넣으세요
    backgroundImg.id = "texture";

    backgroundImg.style.position = 'absolute';
    backgroundImg.style.top = '0';
    backgroundImg.style.left = '0';
    backgroundImg.style.width = '100%';
    backgroundImg.style.height = `${container.scrollHeight}px`; // 전체 높이로 설정
    backgroundImg.style.opacity = '0.08';
    backgroundImg.style.filter = 'saturate(150%) grayscale(50%)';
    backgroundImg.style.pointerEvents = 'none'; // 배경 이미지가 클릭 이벤트를 차단하지 않도록
    backgroundImg.style.zIndex = '1'; // 배경 이미지가 다른 요소들보다 뒤에 있도록

    container.appendChild(backgroundImg);
}

